   { imageUrl: 'asert/thirdadx.jpg', title: 'Slide 1', description: '...' },
  { imageUrl: 'asert/fourpl.jpg', title: 'Slide 2', description: '...' }
  // dynamically fetched or updated
];


 return(
    <div className="container-fluid">
      <h2>Home Page </h2>
       <NavBar BrandTitle="MyApp" MenuItems={["Home","Service","Contect","About","Help"]}/>  
